description:
Wendy (Ginger Lynn) gives a ride to Barry (Jerry Butler) and Peter (Jay Serling) when they arrive in Hawai and can't rent a car. Barry bangs Wendy, but Barry won't have any part of it since he's just been dumped. This being an adult film it doesn't take Barry long to mend his heart at all.

